const TemplateOne = ({ className }: { className: string }) => {
	return (
		<div
			className={'bg-tertiary-bg ' + className}
			style={{ width: '728px', height: '100px' }}
		>
			<div className="w-full h-full p-3 flex items-center justify-between">
				<div className="flex items-center gap-6 h-full">
					<img
						className="rounded-full h-full"
						src="https://cdn.discordapp.com/avatars/670427777757085730/999b6917c1912a51b4c7e1b05f21cee9.png?size=256"
					/>
					<h4>RiznSun#7591</h4>
				</div>
				<div className="w-full">
					<div className="bg-quartiary-bg p-3 rounded-md w-fit justify-end">
						<p className="font-bold">
							Status{' '}
							<span className="font-normal">
								<div
									className="w-4 h-4 bg-red-500 rounded-full mr-3"
									style={{}}
								/>
								Do Not Disturb
							</span>
						</p>
					</div>
				</div>
			</div>
		</div>
	);
};

export default TemplateOne;
